// https://api.mfapi.in/mf/100049

import { useEffect } from "react"


function Table(){
    useEffect(()=>{
        fetch("https://api.mfapi.in/mf/100049")
        .then((res)=>{
           return res.json
        })
        .then((resp)=>{
            console.log(resp)
        })

    })
    return(
        <div>
            <h2>Chart</h2>
        </div>
    )
}
export default Table;
